INSERT INTO `course` VALUES ('DATA201801','Front-End Development with ReactJS Workshop','For: Students who aspire to be a full-stack developer or have interest in frontend development Pre-requisites: Have a good understanding of JavaScript','not offered','N.A.',0),('DATA201802','Natural Language Processing by Taiger Academy','For:  Students interested in learning Artificial Intelligence and practical applications\n\n\n\nPre-requisites: Introduction to Programming/IS Software Foundation & Data Management\n\n\n\nNote: If you do not meet the pre-requisites  please do not register. There will be no refund for registrants who register but do not meet the pre-requisites.\n\n\n\nMin class size: 20 (the class will run only with min size)\n\nMax class size: 30\n\n\n\nInvited Instructors (from Taiger Academy): \n\nProfessors and TAIGER?S own engineers\n\n\n\nSyllabus:\n\n-	3 day in-depth course on Natural Language Processing  with live examples featuring some of TAIGER?S technology.\n\n-	This 3-day course will be conducted by professors and TAIGER?S own engineers with a mix of AI theory and hands on with practical AI tools.\n\n-	Students will not need to have attended the previous Foundations in AI course to gain maximum benefit from this upcoming course.','not offered','N.A.',0),('DATA201803','React.js  development environment','For:  Students who wants to pursue a career as an Application Developer','not offered','N.A.',0),('DATA201804','Jumpstart to Android Programming','-  Utilizing Camera to captured image or as QR Scanner\n\n-  Utilizing GPS to get current location\n\n-  Uploading data to firebase database or storage\n\n\n\nAt the end of the 2nd day  there will be a demonstration of uploading apps to Google PlayStore and sharing personal tips and experience on what to look out for when uploading the app to Google PlayStore!\n\n\n\nWe will be using Android Studio as the IDE to create an android application. Don?t worry if you are using Mac  as Android Studio supports both Windows and Mac Laptop\n\nFor:  Students interested to do some android apps either for Project Experience or for own use\n\n\n\nPrerequisites:  Basic Programming \n\n\n\nMin class size: 12 (the class will run only with min size)\n\nMax class size: 45\n\n\n\nStudent Instructor: WU Jianhua\n\n\n\nSyllabus:\n\nWant to learn how to create Android app? Ever heard of firebase by Google?\n\n \n\nFirebase provides features such as Database  Storage  and Analytics of your Apps. Those features enable you to build better apps. In this enrichment  it gives you a jump-start to android development. In which you will learn how to create an app and integrate it with firebase and utilize its features.\n\n\n\nAnd here are some of the other features of the app:\n\n\n\n-  Logging in using Google Account\n\n-  Utilizing Camera to captured image or as QR Scanner\n\n-  Utilizing GPS to get current location\n\n-  Uploading data to firebase database or storage\n\n\n\nAt the end of the 2nd day  there will be a demonstration of uploading apps to Google PlayStore and sharing personal tips and experience on what to look out for when uploading the app to Google PlayStore!\n\n\n\nWe will be using Android Studio as the IDE to create an android application. Don?t worry if you are using Mac  as Android Studio supports both Windows and Mac Laptop\n\n','not offered','N.A.',0),('DATA201805','SalesCloud','ONLY for matriculated students\n\nFor:  Students who are interested in learning more about salesforce functionalities that allows them to quickly get up to speed on the Salesforce Sales Cloud and its productivity tools. \n\n\n\nPrerequisites: Basic operation of an application through web browser\n\n\n\nMin class size: 12 (the class will run only if min size)\n\nMax class size: 25\n\n\n\nInstructor: LEE Kok Khing\n\n\n\nSyllabus:\n\nStudents will learn how a Sales Representative will use the Sales Cloud to prospect for clients  manage accounts and opportunities  manage workflow  communicate with clients  and run reports.\n\nStudents will also learn how a Sales Manager analyzes and improves sales processes from lead assignment to deal closure using Salesforce Sales Cloud.\n\n\n\nNotes:\n\nÂ    SMU is conducting this course under the Salesforce Academic Alliance.\n\n','not offered','N.A.',0),('DATA201806','Quantum Computing Primer','For: Students who wants to learn about how Quantum Computers differ from current computers  their potential applications and current challenges and issues.\r\n \r\nPrerequisites: Basic understanding of current computer technology e.g. bits and logic gates.\r\n       \r\n \r\nInstructor: Paul GRIFFIN\r\n \r\nSyllabus Details:\r\nThe underlying principles and applications of quantum computing will be discussed and demonstrated. Real life examples will be given with explanations on how quantum computers can help solve some problems more efficiently. Current theoretical and technical issues will also be discussed.\r\nThere will be 2 sessions of 1.5 hours each with a mixture of theory and demonstrations to help understand the different way quantum computers work.\r\nThere will be a prize for any student that generates a new idea for the application of quantum computers or a potential solution to a current issue.','retired','N.A.',0),('DATA201807','Be a Pro Mac User!','For:  Students interested in to maximise their use of their Mac\r\n \r\nPrerequisites:\r\n- You need a Mac to participate\r\n- Bring your charger / adapter\r\n\r\nMin class size: 15 (the class will run only with min size)\r\nMax class size: 30\r\n \r\nStudent Instructors: \r\nGabriel Chuan  Andrew Tay\r\n \r\nSyllabus:\r\nThe key idea of the course is to help students maximise their use of their Mac.\r\nLearn tricks to get better at using your mac. Save time on multiple tasks with these tricks!\r\n\r\nUsing Preview.app\r\nCopying from Powerpoint/Preview quickly\r\nMac Snipping Tool\r\nUsing QuickTime\r\nDisplay iPhone Screen on Mac\r\nRecord Screens\r\nUsing AirDrop\r\nUsing Spectacle.app For Resizing\r\nAccessibility Tips - Invert Colors  ctrl+zoom and gestures\r\nHot Corners - quick logout  etc\r\n(Bonus) Setup homebrew  iTerm and zsh\r\niCalendar.app - Shared Calendar + Delegates\r\nVirtualization / Bootcamp\r\n','retired','N.A.',0),('DATA201808','Introduction to Node.js & NoSQL Databases w/ MongoDB','For: Students who wish to learn more about server-side Javascript web application development with Node.js and go beyond traditional relational database systems  exploring concepts around document-oriented NoSQL databases Retired N.A.\r\nDATA201809 Blockchain and Smart Contracts For: Students who wants to learn how to create and program blockchains and Smart Contracts.','retired','N.A.',0),('DATA201809','Blockchain and Smart Contracts','For: Students who wants to learn how to create and program blockchains and Smart Contracts.\r\n \r\nPrerequisites: Basic programming experience  Javascript is best. Must bring a PC for lab section.\r\n \r\nMin class size: 5 (the class will run only with min size)\r\nMax class size: 45\r\n \r\nInstructor: Paul GRIFFIN\r\n \r\nSyllabus Details:\r\nBlockchain and Smart Contracts are at the heart of new disruptions to finance and other industries with crypto-currencies such as BitCoin and distributed ledgers being used by many start-ups. This class provides the background and how to start programming these important technologies.\r\nThere will be 2 sessions of 3 hours each with a mix of theory and hands-on work. By the end of the sessions participants will be able to install a blockchain  mine blocks and write  deploy and execute Smart Contracts. \r\nWe will be using Ethereum as the blockchain and Smart Contract engine and program in Solidity. A knowledge of programming is assumed but only up to understanding scripts (ideally Javascript).','retired','N.A.',0),('DATA201810','Web Data Extraction and Regression Analysis','For: SMU undergraduates  postgraduates  and staff who are interested in collection and analysis of Web data.\r\n \r\nPrerequisites: Knowledge of Java programming.\r\n \r\nMin class size: 15 (the class will run only with min size)\r\nMax class size: 30\r\n \r\nInstructor: Preferred.AI (http://preferred.ai)\r\n \r\nSyllabus Details:\r\nThe Web is an enormous repository of data.  Frequently  in our work or study  we need to access some information from the Web for projects  market research  hypothesis testing  application development  etc. In this course  we cover the fundamentals of how data on the Web are represented  how we can construct programs that systematically extract data from specific Web sources and organize them into a structured form  and how to conduct regression analysis for basic prediction tasks. This is a hands-on course.  Attendees are expected to attend all five days  and to complete a small group project by the end of the course.\r\n1.	Representations of Web data and focused crawling\r\n2.	Data extraction workshop\r\n3.	Regression analysis\r\n4.	Data analysis workshop\r\n5.	Project presentations and evaluation','retired','N.A.',0),('DATA201811','Jumpstart to iOS programming','For:  Students interested in to build iOS application\r\n\r\nPrerequisites: \r\n- You need a Mac to participate\r\n- Generally proficient in Java programming  as Swift has very similar syntax\r\n\r\nMin class size: 15 (the class will run only with min size)\r\nMax class size: 30\r\n\r\nInstructor: ONG Hong Seng\r\n\r\nSyllabus:\r\nThe key idea of the course is to give a jumpstart for student who are interested to build iOS apps\r\n1.	Getting started \r\n2.	Deploying app to simulator and device(s)\r\n3.	Coding in Swift\r\n4.	Building a simple app\r\n5.	Knowing how to progress with given iBooks','retired','N.A.',0),('DATA201812','Understanding Blockchain','For: Students interested in blockchain technology. \r\n \r\nPrerequisites:  Nil\r\n\r\nMin class size: 15 (the class will run only with min size)\r\nMax class size: 40\r\n \r\nInstructor: Trainer from NEM\r\n \r\nSyllabus Details:\r\nBlockchain 101 & NEM 101\r\nBlockchain 101 (1 day)\r\nIn this module  you will learn about what is Blockchain and its characteristics. It will bring you down the history of the emergence of Blockchain technology  what triggered it and how it caught the attention of the world. You will be exploring the important mechanisms of the Blockchain and how it can change the world around you. Most important of all  what role you can play.\r\nKey topics include:\r\n- The Technology behind Blockchain\r\n- Features of Blockchain\r\n- History of Blockchain\r\n- Features of Blockchain\r\nNEM 101 (1 day)\r\nIn this module  NEM will be introduced to you. Its history  its architectural design  its consensus protocol  its Smart Assets and their features. Comparison of NEM with other Blockchains and the advantages using NEM Blockchain will also be discussed. You will find everything you need to know before you take the leap of faith.\r\n- History of NEM\r\n- NEM architecture\r\n- Advantages of using NEM\r\n- NEM Assets\r\n- Harvesting\r\n- Consensus protocol\r\n- Comparison','retired','N.A.',0),('DATA201813','Dynamic Programming','For:\r\n1.   Students who have strong interests in algorithms\r\n2.   Prepare students for the course IS448 Introduction to Artificial Intelligence.\r\n \r\nPrerequisites: \r\nIS103 Computational Thinking\r\n \r\nMin class size: 5 (the class will run only if the min size is met)\r\nMax class size: 40\r\n \r\nInstructor:  DAI Bing Tian\r\n \r\nSyllabus Details:\r\n-	Recursion and Iteration\r\n-	Dynamic programming','not offered','N.A.',0),('DATA201814','Big Data Analytics with kdb+','For: Students interested in big data and using the kdb+ technology for ultra-high-speed processing of real-time  streaming and historical data.\r\n \r\nPrerequisites: \r\n-       Keen interest in big data\r\n-       Prior academic or professional experience with any programming language  i.e. Java  R  Python  Matlab\r\n-       Students must attend the introductory session on 17 Dec to take part in the hands-on workshop on 18 Dec\r\nMin class size: 15 (the class will run only with min size)\r\nMax class size: 30\r\n \r\nInstructor: Warren Yong & Eamonn McKernan\r\n \r\nAbout Kx: Kx is a global technology provider with 20 years of experience working with some of the world?s largest finance  technology  retail  pharma  manufacturing and energy institutions. Kx technology  incorporating the kdb+ time-series database  is a leader in high-performance  in-memory computing  streaming analytics and flexibility for high-volume  data-intensive analytics and applications across multiple industries.\r\n\r\nSyllabus Details:\r\nJoin us for 1.5 days of exciting sessions on the power Kx technology  interesting real-life use cases and a hands-on coding workshop.\r\n \r\nThe first session will entail explaining how Kx supports streaming analytics on extremely large datasets that would simply swamp traditional technologies. This talk is a perfect opportunity to learn about the power and scalability of Kx and how it can be applied to real-life business problems across a range of industries from Finance to retail and the evolving challenges of IoT and everywhere connected.\r\n \r\nThe follow-up full day workshop will help students gain insight into the world?s fastest time-series database  kdb+ and the many features of its q programming language. This hands-on session explains how kdb+ can address today?s data challenges. The program highlights the advantages of using q to analyse massive data sets and obtain real insights.\r\n\r\nAt the end of both days  students will receive a complementary Kx certification stipulating his/her completion of the introductory kdb+ Level 1 course including kdb+ concepts  programming and data mining techniques. Given our diversified client pool across institutions such as NASA  Red Bull Racing and closer to home  SGX  GIC and Standard Chartered  we encourage students to include this on their resumes for increased visibility during job searches as well as knowledge of the Kx technology which is highly relevant in the industry today!\r\n\r\nIn terms of transferable skills  students should be able to grasp through the workshop:\r\n1.	How information is captured and stored\r\n2.	How to query this information\r\n3.	What are the best techniques to mine this data\r\n4.	What are the best tools to visualise this data set\r\n5.	Architecture design','retired','N.A.',0),('DATA201901','Overview of Big Data with Kx','DATA201901 Description','retired','N.A.',0),('DATA201902','SAP Analytics Cloud','DATA201902 Description','retired','N.A.',0),('DATA201903','Quantum Leap','A gentle intorduction to quantum computing with real examples','retired','N.A.',0),('DATA201904','Blockchain and Smart Contracts','Hands on coding of blockchain and smart contracts','retired','N.A.',0),('DATA201905','How to explore and navigate analytic dashboards with TIBCO Spotfire X','DATA201905 Description','not offered','N.A.',0),('DATA202001','Overview of Big Data with Kx (Revised)','DATA202001 Description','retired','N.A.',0),('DATA202002','Analysing data made easy with SAP Analytics Cloud','DATA202002 Description','not offered','N.A.',0),('DATA202003','Data Analysis with Python','DATA202003 Description','retired','N.A.',0),('DATA202004','Quantum Leap','The overall objective of the course is to understand quantum computing','retired','N.A.',0),('DATA202005','Stress Management with Technology','Learn about the impact of stress and how to manage stress using technology','not offered','N.A.',0),('DATA202006','FISCO BCOS Blockchain & Hands-on Experience | WeBank Workshop','Gain the basic knowledge of FISCO BCOS and its open source community','retired','N.A.',0),('DATA202007','FISCO BCOS Blockchain & Hands-on Experience | WeBank Workshop','DATA202007 Description','retired','N.A.',0),('DATA202008','Intro to Digital Marketing','DATA202008 Description','retired','N.A.',0),('DATA202009','Acquia Certified Site Builder','DATA202009 Description','retired','N.A.',0),('DATA202010','Intro to Drupal','DATA202010 Description','retired','N.A.',0),('DATA202011','MuleSoft Workshop','DATA202011 Description','retired','N.A.',0),('DATA202101','Dashboard Specialist','DATA202101 Description','retired','N.A.',0),('DATA202102','Quantum Leap','DATA202102 Description','retired','N.A.',0),('DATA202103','Intro to FISCOS BCOS Blockchain | WeBank Workshop','DATA202103 Description','retired','N.A.',0),('DATA202104','Cybersecurity - Introduction to SSL Certificates','DATA202104 Description','retired','N.A.',0),('DATA202105','Python Programming for Data Analysis','students will learn the key Python libraries for exploring and manipulating real world data','retired','N.A.',0),('DATA202106','SAP Cloud Accelerated Learning Experience (S.C.A.L.E)','DATA202106 Description','retired','N.A.',0),('DATA202107','Pega System Architect Essentials','Begin your journey as a System Architect with Pega technology by learning the capabilities of the Pega Platform Reporting','retired','N.A.',0),('DATA202108','Mulesoft certification','DATA202108 Description','not offered','N.A.',0);
